import {
  USER_LOGIN_SUCCESS,
  USER_LOGIN_FAIL,
  USER_REGISTER_SUCCESS,
  USER_REGISTER_FAIL,
  GET_AUTH_USER_SUCCESS,
  GET_AUTH_USER_FAIL,
} from "../types";

export default function (state = {}, action) {
  const { type } = action;
  switch (type) {
    case USER_LOGIN_SUCCESS:
      return {
        ...state,
        ...action,
      };
    case USER_LOGIN_FAIL:
      return {
        ...state,
        ...action,
      };
    case USER_REGISTER_SUCCESS:
      return {
        ...state,
        ...action,
      };
    case USER_REGISTER_FAIL:
      return {
        ...state,
        ...action,
      };
      case GET_AUTH_USER_SUCCESS:
        return {
          ...state,
          ...action,
        }
    default:
      return state;
  }
}
